import React from 'react';
import styled from "styled-components";
import {Container, Subtitle} from "../../styles/common";

const StyledPromo = styled.div`
  background: url("../../img/promo/background.svg") center/cover;
`

const PromoInner = styled(Container)`
  display: flex;
  align-items: center;
  justify-content: space-between;
`

const PromoContent = styled.div`
  max-width: 530px;
`

function Promo() {
  return (
    <StyledPromo>
      <PromoInner>
        <PromoContent>
          <Subtitle color="#FFFFFF">100% Natural Food</Subtitle>
        </PromoContent>
        <PromoContent>

        </PromoContent>
      </PromoInner>
    </StyledPromo>
  );
}

export default Promo;
